    template<int pawnColor>
    inline bool isWin(const int side, const int kw, const int kb, const int pawn) {
        return pawnColor == WHITE ? KPK_WHITE[side][kw][kb] & (1ULL << pawn) : KPK_BLACK[side][kw][kb] & (1ULL << pawn);
    }
