// TODO eliminare
#include "../GTB.h"
#include "../../util/Singleton.h"

class KPK: public Singleton<KPK> {
    friend class Singleton<KPK>;

private:
    u64 kpkBitbaseWhite[2][64][64];
    u64 kpkBitbaseBlack[2][64][64];
public:
    void init() {
        memset(kpkBitbaseWhite, 0, sizeof(kpkBitbaseWhite));
        memset(kpkBitbaseBlack, 0, sizeof(kpkBitbaseBlack));
        cout << "{{\n";
        TODOpopulate(BLACK, BLACK);
        cout << "},{\n";
        TODOpopulate(WHITE, BLACK);
        cout << "}}\n";
        cout << "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa\n";

        memset(kpkBitbaseWhite, 0, sizeof(kpkBitbaseWhite));
        memset(kpkBitbaseBlack, 0, sizeof(kpkBitbaseBlack));
        cout << "{{\n";
        TODOpopulate(BLACK, WHITE);
        cout << "},{\n";
        TODOpopulate(WHITE, WHITE);
        cout << "}}\n";
    }

    void TODOpopulate(const int side, const int pawncolor) {
        _Tchessboard chessboard;
        memset(chessboard, 0, sizeof(_Tchessboard));
        GTB &gtb = GTB::getInstance();
        gtb.setPath("/gtb4");
        for (int kw = 0; kw < 64; kw++)
            for (int kb = 0; kb < 64; kb++)
                for (int p = 0; p < 64; p++) {
                    if (kw == kb || kw == p || kb == p)continue;
                    chessboard[KING_WHITE] = POW2[kw];
                    chessboard[KING_BLACK] = POW2[kb];
                    chessboard[PAWN_BLACK + pawncolor] = POW2[p];
//                    if (kw == 23 && kb == 43 && p == 37)
//                       cout <<"TODOOOOOO";
                    const auto res = gtb.getDtm(side, false, chessboard, 0, 100);
                    if (res != GTB_DRAW && (res - GTB_OFFSET) >= 0 && abs(res) != INT_MAX) {
                        if (pawncolor == WHITE) kpkBitbaseWhite[side][kw][kb] |= POW2[p]; else
                            kpkBitbaseBlack[side][kw][kb] |= POW2[p];
                    }
                }

        for (int i = 0; i < 64; i++) {
            cout << endl;
            cout << "{";
            for (int j = 0; j < 64; j++) {
                if (pawncolor == WHITE) cout << "0x" << hex << kpkBitbaseWhite[side][i][j] << "ULL,"; else
                    cout << "0x" << hex << kpkBitbaseBlack[side][i][j] << "ULL,";
            }
            cout << "},";
        }

    }

};

